import React, { useState } from "react";
import { Link } from "react-router-dom";
import homeSVG from '../svg/home.svg';
import xSVG from '../svg/x.svg'; // Replace with your X SVG file

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <nav>
        <div className="container mx-auto flex justify-between items-center">
          <Link to="/">
            <img src={homeSVG} alt="Home SVG" />
          </Link>
          <div className="sm:hidden">
            <button
              type="button"
              className="text-black block"
              onClick={toggleNavbar}
            >
              {/* Conditionally render SVG based on isOpen state */}
              {isOpen ? (
                <img
                  src={xSVG}
                  className="h-6 w-6 fill-current text-black"
                  alt="Close"
                />
              ) : (
                <svg
                  className="h-6 w-6 fill-current text-black"
                  viewBox="0 0 24 24"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    fillRule="evenodd"
                    clipRule="evenodd"
                    d="M4 6L20 6V5L4 5V6ZM20 11L4 11V10L20 10V11ZM20 16L4 16V15L20 15V16Z"
                  />
                </svg>
              )}
            </button>
          </div>
          <div className={`${isOpen ? "block" : "hidden"} sm:flex sm:flex-col sm:mt-4`}>
            {/* Navigation links */}
            <Link
              to="/generate-recipe"
              className="text-black px-2 py-1 rounded-md font-medium hover:bg-gray-700 sm:block"
            >
              Generate Recipe
            </Link>
            <Link
              to="/view-recipes"
              className="text-black px-2 py-1 rounded-md font-medium hover:bg-gray-700 sm:block"
            >
              View Recipes
            </Link>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
